    [],nt"num_tags": 5,nt"name": "1984-walrus-harvest-health-and-welfare-study-at-nome-alaska-progress-report",nt"isopen":
    false,nt"url": null,nt"notes": "Walrus (Odobenus resmarus) harvest data
    was collected for the Nome and King Island area from May 10 to July 10, 1984 by
    the U.S. Fish and Wildlife Service (FWS) with cooperation from the Eskimo Walrus
    Commission (EWC). The documented minimum retrieved harvest for Nome and King Island,
    respectively, was 46 and 111 walruses, far below harvest levels experienced during
    the preceding four years. The harvest from King Island was comprised of a majority
    of female walruses for the first time. Changes in the sex ratio of the harvest from
    Nome wereu00b7 inconclusive due to the low number of animals taken. Forty-five pairs
    of teeth, for ageing purposes, and three sets of specimens for contaminant analysis
    were acquired. Take of other marine mammals for Nome and King Island incidental
    to walrus hunting included a minimum of 91 bearded seal (Erignathus barbatus), 25
    ringed seal (Phoca hispida), spotted seal (Phoca largha), 2 unidentified seals and
    1 polar bear (Ursus maritimus). Prolonged consolidated ice conditions in the Norton
    Sound bel1eved to have limited hunting success.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
